DROP TABLE IF EXISTS `db_book`;
CREATE TABLE `db_book`  (
  `book_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '图书编号',
  `book_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '书名',
  `book_info` varchar(150) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '介绍',
  `image` varchar(300) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '图片',
  `price` decimal(10, 2) NULL DEFAULT NULL COMMENT '单价',
  `author` varchar(30) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '作者',
  `sales` int(10) NULL DEFAULT NULL COMMENT '销量',
  `stock` int(10) NOT NULL COMMENT '库存',
  `tag_name` varchar(60) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '标签',
  `press_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '出版社FK',
  `transit` decimal(10, 0) NULL DEFAULT NULL COMMENT '运费',
  `state` bit(1) NULL DEFAULT NULL COMMENT '发布状态',
  `book_pub_time` datetime NULL DEFAULT NULL COMMENT '出版时间',
  `add_Time` datetime NOT NULL COMMENT '入库时间',
  `remark` varchar(150) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`book_id`) USING BTREE,
  INDEX `book_name`(`book_name`) USING BTREE,
  INDEX `db_book_ibfk_1`(`press_name`) USING BTREE,
  CONSTRAINT `db_book_ibfk_1` FOREIGN KEY (`press_name`) REFERENCES `db_press` (`press_name`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

